import React, {useState, useEffect}from 'react'
import * as Bluetooth from 'react-bluetooth';
import './UI.css'

const UI = () => {
    // const { onClick, device } = useRequestDevice({
    //     acceptAllDevices: true,
    //   });
    
    const [mqSensor, setMqSensor] = useState("")
    
        // useEffect(() => {
    //     fetch("https://api.thingspeak.com/channels/1448369/feeds.json?api_key=26YJJ2LHV1WQA3AL&results=1")
    //     .then(response => response.json())
    //     .then(data => setMqSensor(data.feeds[0]["field1"]))
    // },[mqSensor])
   
        async function syncBluetooth() {
            
                const result = await Bluetooth.requestDeviceAsync({
                    acceptAllDevices: true,
                    optionalServices: ['battery_service'] // Required to access service later.
                }).then(device => {
                    console.log(device)
                    return device.device.gatt.connect()
                }).then(service => {
                    console.log(service)
                }).catch(err => console.log("err", err));
                //const device = result.device;
                //console.log(device)
                //setMqSensor(device)
        }
           
    //console.log(mqSensor)
    
    return(
        <div className="container">
            <div className="dashboard">
                <h1 className="dashboardTitle">Air Quality Sensors</h1>
                <img src="data:image/svg+xml;base64," sizes="10px"/>
                {/* <h2 className="airValue">{mqSensor.substring(0, mqSensor.length - 2)} PPM</h2> */}
                <button onClick={syncBluetooth}>Get Bluetooth</button>
            </div>
            {/* {!device && <button onClick={onClick}>Connect</button>}
  {device && <span>{device.name}</span>} */}
        </div>
        
        
    )
}

export default UI
